import React from "react";
import Grid from "@material-ui/core/Grid";

const LpText = () => {
    return (
        <Grid container item className="Lp_items">
            <h1>Stay Productive and</h1>
            <br></br>
            <h1>Work Remotely</h1>
        </Grid>
    )
}

export default LpText;
